import React from 'react';

class GamePage extends React.Component {
    constructor (props) {
        super (props);
        this.state = {
            size: 4,
            grid: Array(4*4)
        };
        for (let i = 0;i < this.state.size*this.state.size; i++) this.state.grid[i] = 0;
    }
    render() {
        const size = this.state.size;
        var Grid = '';
        for (let i = 0;i < 4*4; i++) {
            if (i % 4 == 0) Grid = '<tr>' + Grid;
            Grid = '<td>'+'0'+'</td>';
            if (i % 4 == 4-1) Grid = Grid + '/<tr>';
        }
        return (
            <div>
                <table>
                    {Grid}
                </table>
            </div>
        );
    }
}

export default GamePage;
